C.as2=new L.E("The menu has its own app bar locked to the top, when expanded from Rail to Menu you can often fit a company logo or app name in it. Below the menu app bar there is a leading widget before the actual menu destinations, that are followed by a trailing widget and finally a footer that sticks to the bottom of the menu.\n\nYou do not have to use leading, trailing and footer widgets, but they are available if you need them. The menu app bar and the menu footer do not scroll, but the rest of the menu widgets will scroll if the items do not fit vertically.\n\nA FlexfoldDestination class is used to define navigation destinations. You can define if a destination is included in the bottom navigation mode or not. For the menu you can define if there is a divider before or after each destination and if it has a heading. Does the destination have a FAB? Maybe a sidebar too? The configuration is very similar to Flutter NavigationRail destinations, but with a few more properties. Flexfold also has a custom theme FlexfoldThemeData, used to style the Flexfold scaffold and define values for less used properties.",null,null,null,null,null,null,null,null)
