C.apb=new L.E("Theming is not a part of Flexfold, the theming shown here is done with another package called FlexColorScheme. This page presents the kind of theming that it simplifies.\n\nFlexColorScheme uses Flutter's newer ColorScheme based themes. Similarly to the ThemeData.from factory, it also creates Themes from ColorSchemes. It has two convenience factories, FlexColorScheme.light and FlexColorScheme.dark. It also addresses some theme gaps in the standard Theme.from ColorScheme based theming.\n\nFlexColorScheme supports using Material and custom colored app bar themes in light and dark mode. Dark theme mode also support a darker mode than Material dark theme, called true black.\n\nYou can blend primary color into surface colors with different strengths, to create color branded light and dark themes.\n\nIn addition to the default Material design theme, FlexColorScheme comes with a few more built-in themes to get you started with theming your app.\n",null,null,null,null,null,null,null,null)
