C.arA=new L.E("Flexfold is a smooth responsive scaffold package for Flutter. This application demonstrates its core features.\n\nThe responsive navigation modes automatically change from bottom navigation bar, to rail and to side menu as the canvas size grows. The smooth part is that the switches from one mode to another are animated.\n\nOn a large canvas the user can control the desired navigation mode with the menu button and toggle the side menu from being hidden in a drawer, to a rail and to be fully visible as a side menu. You change navigation mode by clicking on the menu button. The menu button only toggles the menu style between allowed navigation modes based on current canvas size and defined navigation mode breakpoint constraints.\n",null,null,null,null,null,null,null,null)
