C.asc=new L.E("With Flexfold it is easy to include a gradient transparent app bar. There is a styled app bar factory to help make app bars like the one you see in this demo. When you combine the gradient transparent app bar with a white app bar theme, you get a Material themed app bar that resembles common iOS style app bars a bit. If you want to go full iOS style, then use the frosted glass blur style on a Material app bar as well. The frosted glass style is ON by default in this demo, but feel free to experiment with different settings.\n\nThis page uses a vertical scroll view that stops just before the tab bar, so you will not see the scroll behind app bar effect on this particular page. It is however visible on all other pages in this demo app.\n\nThe Settings page already contains the app bar settings below. This page just explains in a bit more detail how the app bar  made with the styled factory can be useful. There is also a feature that shows the current canvas size in the app bar. You can use it to verify that your responsive layouts work as designed during development.\n",null,null,null,null,null,null,null,null)
